import React, {Component} from 'react';
import {
  Alert,
  Image,
  ScrollView,
  StyleSheet,
  Text,
  TouchableOpacity,
  View,
  Platform,
} from 'react-native';
import ImagePicker from 'react-native-image-picker';

import {HappyAlert} from '../components/HappyAlert';

import {HEIGHT} from '../services';
import {t} from '../services/i18n';
import {
  getStores,
  setStoreCloseDay,
  getCurrentStore,
  deleteCurrentStore,
  deleteLastStoreUpdate,
} from '../services/store';
import {logout} from '../services/auth';

import Logo from '../images/logo.png';
import theme from '../styles';

const MRbinimg =
  'data:image/png;base64,';

export default class CloseDaySetStore extends Component {
  constructor(props) {
    super(props);

    this.submitHandler = this.submitHandler.bind(this);

    this.state = {
      currentStore: {title: ''},
      typeOfAction: this.props.navigation.getParam('type', 'none'),
      // avatarSource: {uri: MRbinimg},
      avatarSource: null,
      avatarPreview: null,
      // avatarPreview: {uri: MRbinimg},
      request: false,
      showHappyAlert: false,
    };
  }

  componentDidMount() {
    getCurrentStore().then(response => {
      this.setState({
        currentStore: response,
      });
    });
  }

  shouldComponentUpdate(nextProps, nextState) {
    if (nextState.typeOfAction !== nextProps.navigation.getParam('type')) {
      this.setState({
        typeOfAction: nextProps.navigation.getParam('type'),
      });
    }

    return true;
  }

  static navigationOptions = () => ({
    title: 'Perfums Bar',
  });

  setCurrentStore = () => {
    const {navigation} = this.props;
    const {typeOfAction, currentStore, avatarPreview} = this.state;
    const body = {
      photo: avatarPreview.uri,
    };

    setStoreCloseDay(body, currentStore.idEvent)
      .then(res => {
        if (res) {
          if (typeOfAction === 'logout') {
            this.setState(
              {
                showHappyAlert: true,
              },
              () => {
                logout();
                setTimeout(
                  () =>
                    navigation.reset({
                      index: 0,
                      routes: [{name: 'Login'}],
                    }),
                  3000,
                );
              },
            );
          } else {
            deleteCurrentStore();
            deleteLastStoreUpdate();
            this.setState(
              {
                showHappyAlert: true,
              },
              () => {
                setTimeout(
                  () =>
                    navigation.reset({
                      index: 0,
                      routes: [{name: 'SetStore'}],
                    }),
                  3000,
                );
              },
            );
          }
        }
      })
      .catch(e => {
        // TODO: check error types
        Alert.alert('', t('Check if geolocation is enabled'));
      });
  };

  submitHandler = () =>
    this.setState(
      ({request}) => ({request: !request}),
      () => this.setCurrentStore(),
    );

  getPhotoCamera = () => {
    const options = {
      title: 'Select Avatar',
      customButtons: [{name: 'fb', title: 'Choose Photo from Facebook'}],
      quality: 0.3,
      storageOptions: {
        skipBackup: true,
        path: 'images',
      },
    };
    ImagePicker.launchCamera(options, response => {
      // Same code as in above section!
      if (response.didCancel) {
        console.log('User cancelled image picker');
      } else if (response.error) {
        console.log('ImagePicker Error: ', response.error);
      } else if (response.customButton) {
        console.log('User tapped custom button: ', response.customButton);
      } else {
        const source = {uri: response.uri};

        // You can also display the image using data:
        const preview = {uri: 'data:image/jpeg;base64,' + response.data};

        this.setState({
          avatarSource: source,
          avatarPreview: preview,
        });
      }
    });
  };

  render() {
    const {
      typeOfAction,
      currentStore,
      avatarSource,
      avatarPreview,
      request,
      showHappyAlert,
    } = this.state;

    const activeSubmit = avatarSource && avatarPreview && !request;
    const showPreview = avatarSource && avatarPreview;

    return (
      <ScrollView style={{flex: 1}}>
        <HappyAlert
          showHappyAlert={showHappyAlert}
          type="end_day"
          currentStore={currentStore.id}
        />

        <View style={[styles.container, {height: HEIGHT - 80}]}>
          <View
            style={{borderBottomWidth: 1, marginBottom: 5, paddingBottom: 5}}>
            <Text style={[styles.label, {fontWeight: 'bold'}]}>
              {t('Closing the working day')}
            </Text>
          </View>
          <View style={styles.currentShopContainer}>
            <Image
              source={
                Platform.OS === 'ios'
                  ? Logo
                  : {uri: 'asset:/images/logo_android.png'}
              }
              style={styles.shopLogo}
            />
            {/*<Image source={Logo} style={styles.shopLogo}/>*/}
            <Text>{currentStore.title}</Text>
          </View>

          <TouchableOpacity
            onPress={this.getPhotoCamera}
            style={theme.simpleButtons}>
            <Text style={theme.simpleButtonText}>
              {t(showPreview ? 'Change picture' : 'Take picture').toUpperCase()}
            </Text>
          </TouchableOpacity>

          {showPreview && (
            <View style={styles.avatarBlock}>
              <Image source={avatarSource} style={styles.uploadAvatar} />
            </View>
          )}

          <TouchableOpacity
            onPress={activeSubmit ? this.submitHandler : undefined}
            style={[
              theme.simpleButton,
              {marginTop: 20},
              {backgroundColor: activeSubmit ? '#000' : '#888'},
            ]}>
            <Text style={theme.simpleButtonText}>
              {typeOfAction === 'logout'
                ? t('Logout').toUpperCase()
                : t('Confirm').toUpperCase()}
            </Text>
          </TouchableOpacity>
        </View>
      </ScrollView>
    );
  }
}

const styles = StyleSheet.create({
  container: {
    padding: 10,
  },
  label: {
    textAlign: 'center',
    fontSize: 22,
  },
  avatarBlock: {
    padding: 10,
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
  },
  uploadAvatar: {
    marginTop: 20,
    marginBottom: 20,
    height: 200,
    width: 200,
  },
  currentShopContainer: {
    flexDirection: 'row',
    justifyContent: 'center',
    alignItems: 'center',
    paddingBottom: 20,
    paddingTop: 20,
  },
  shopLogo: {
    width: 50,
    height: 50,
    marginRight: 10,
  },
});
